DROP TABLE IF EXISTS `wooshop_goods_evaluation`;
CREATE TABLE `wooshop_goods_evaluation` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `uid` bigint(19) DEFAULT '0' COMMENT '用户ID',
  `order_id` bigint(19) DEFAULT '0' COMMENT '订单ID',
  `goods_attr_unique` varchar(32) DEFAULT NULL COMMENT '商品规格唯一id',
  `goods_id` bigint(19) DEFAULT NULL COMMENT '商品id',
  `goods_type` tinyint(1) DEFAULT '1' COMMENT '商品类型(1普通商品、2秒杀商品、3团购商品、4砍价商品）',
  `goods_score` tinyint(1) DEFAULT NULL COMMENT '商品分数',
  `service_score` tinyint(1) DEFAULT NULL COMMENT '服务分数',
  `comment` varchar(530) DEFAULT NULL COMMENT '评论内容',
  `evaluation_img` text COMMENT '评论图片',
  `admin_reply_content` varchar(300) DEFAULT NULL COMMENT '管理员回复内容',
  `admin_reply_time` datetime DEFAULT NULL COMMENT '管理员回复时间',
