  `is_reply` tinyint(1) DEFAULT '0' COMMENT '0未回复1已回复',
  `nickname` varchar(100) DEFAULT NULL COMMENT '用户名称',
  `avatar` varchar(250) DEFAULT NULL COMMENT '用户头像',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `goods_sku` varchar(250) DEFAULT NULL COMMENT '商品规格属性值,多个,号隔开',
  `seller_id` bigint(19) DEFAULT '0' COMMENT '店铺id',
  `is_start` tinyint(1) DEFAULT '1' COMMENT '状态（0：不显示，1：显示）',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `goods_type` (`goods_type`) USING BTREE,
  KEY `is_del` (`is_del`) USING BTREE,
  KEY `goods_score` (`goods_score`) USING BTREE,
  KEY `service_score` (`service_score`) USING BTREE,
  KEY `uid+order_id` (`uid`,`order_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='评论表';

