  `uid` bigint(19) NOT NULL DEFAULT '0' COMMENT '用户uid',
  `sign_title` varchar(250) NOT NULL DEFAULT '' COMMENT '签到说明',
  `gain_number` int(9) NOT NULL DEFAULT '0' COMMENT '获得',
  `after_balance` int(9) NOT NULL DEFAULT '0' COMMENT '剩余',
  `sign_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '获得类型，1积分，2经验',
  `create_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间/签到时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `create_day` date DEFAULT NULL COMMENT '创建时间 不含时分秒',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除 1删除 默认0',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `uid` (`uid`,`sign_type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员签到记录表';

-- ----------------------------
-- Records of wooshop_sign_record
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_stores
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_stores`;
CREATE TABLE `wooshop_stores` (
  `id` bigint(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `stores_name` varchar(150) NOT NULL DEFAULT '' COMMENT '店铺名称',
  `stores_info` varchar(1500) NOT NULL DEFAULT '' COMMENT '店铺信息',
  `telephone` char(25) NOT NULL DEFAULT '' COMMENT '店铺联系手机号码',
  `contact_name` varchar(150) NOT NULL DEFAULT '' COMMENT '店铺联系称呼',
  `stores_address` varchar(250) NOT NULL DEFAULT '' COMMENT '省市区',
  `detailed_address` varchar(500) NOT NULL DEFAULT '' COMMENT '详细地址',
  `stores_logo` varchar(250) NOT NULL DEFAULT '' COMMENT '门店logo',
  `latitude` char(50) DEFAULT NULL COMMENT '店铺地址纬度',
  `longitude` char(50) DEFAULT NULL COMMENT '店铺地址经度',
  `valid_time` varchar(100) DEFAULT '' COMMENT '允许核销有效日期',
  `day_time` varchar(100) NOT NULL DEFAULT '' COMMENT '营业时间',
  `is_start` tinyint(1) NOT NULL DEFAULT '1' COMMENT '店铺状态:1开启 0隐藏',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `is_take` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否允许自提:1允许 0不允许',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `uid` bigint(19) DEFAULT NULL COMMENT '管理用户id',
  `is_auth` tinyint(1) DEFAULT '1' COMMENT '0 需要审核 并且待审核，1 不需要审核 2需要审核 且审核通过 3 需要审核 且审核未通过',
  `auth_message` varchar(255) DEFAULT NULL COMMENT '审核信息',
  `sort` int(4) DEFAULT '99' COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `telephone` (`telephone`) USING BTREE,
  KEY `is_start` (`is_start`) USING BTREE,
  KEY `uid` (`uid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='店铺信息表';

-- ----------------------------
-- Records of wooshop_stores
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_store_goods
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_store_goods`;
CREATE TABLE `wooshop_store_goods` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '商品主键id',
  `goods_info` varchar(255) DEFAULT NULL COMMENT '商品介绍',
  `goods_name` varchar(255) NOT NULL COMMENT '商品名称',
  `slideshow` varchar(3000) DEFAULT NULL COMMENT '轮播图',
  `cover_image` varchar(256) DEFAULT NULL COMMENT '商品主图片',
  `meta_keywords` varchar(255) DEFAULT NULL COMMENT 'seo关键字',
  `bar_code` varchar(50) DEFAULT NULL COMMENT '商品条码（一维码）',
  `category_id` varchar(255) NOT NULL COMMENT '商品分类id',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '商品价格',
  `mktprice` decimal(10,2) DEFAULT '0.00' COMMENT '市场价格',
  `goods_transfee_charge` tinyint(1) DEFAULT '1' COMMENT '谁承担运费0：买家承担，1：卖家承担',
  `goods_unit` varchar(50) DEFAULT NULL COMMENT '计量单位',
  `buy_count` int(10) DEFAULT '0' COMMENT '购买数量',
  `quantity` int(10) DEFAULT '0' COMMENT '总的库存数量',
  `is_start` tinyint(1) DEFAULT '1' COMMENT '状态（0：未上架，1：上架）',
  `is_benefit` tinyint(1) DEFAULT '0' COMMENT '是否优惠  1是',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '是否热卖 1热卖',
  `is_best` tinyint(1) DEFAULT '0' COMMENT '是否精品 1是',
  `is_new` tinyint(1) DEFAULT '0' COMMENT '是否新品 1是',
  `give_integral` int(10) DEFAULT '0' COMMENT '购买商品获得积分',
  `is_integral` tinyint(1) DEFAULT '1' COMMENT '积分抵扣状态:0不开启、1开启抵扣',
  `cost` decimal(10,2) DEFAULT '0.00' COMMENT '成本价格',
  `seckill_start` tinyint(1) DEFAULT '0' COMMENT '秒杀状态 0未开启 1已开启',
  `bargain_start` tinyint(1) DEFAULT '0' COMMENT '砍价状态 0未开启 1开启',
  `good_start` tinyint(1) DEFAULT '0' COMMENT '是否优质商品推荐 0否 1是',
  `distribution_start` tinyint(1) DEFAULT '0' COMMENT '是否单独分销佣金 1独立 0非独立',
  `fictitious_volume` int(10) DEFAULT '0' COMMENT '虚拟销量',
  `view_count` int(10) DEFAULT '0' COMMENT '浏览数量',
  `code_path` varchar(100) DEFAULT NULL COMMENT '商品二维码地址(用户小程序海报)',
  `template_id` bigint(19) DEFAULT NULL COMMENT '运费模板id',
  `spec_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '规格类型 0单规格 1多规格',
  `self_operated` tinyint(1) DEFAULT '1' COMMENT '是否是自营商品 0 不是 1是',
  `is_auth` int(1) DEFAULT '1' COMMENT '0 需要审核 并且待审核，1 不需要审核 2需要审核 且审核通过 3 需要审核 且审核未通过',
  `auth_message` varchar(255) DEFAULT NULL COMMENT '审核信息',
  `under_message` varchar(255) DEFAULT NULL COMMENT '下架原因',
  `comment_num` int(10) DEFAULT NULL COMMENT '评论数量',
  `grade` decimal(10,2) DEFAULT '0.00' COMMENT '商品好评率',
  `promise_id` varchar(150) DEFAULT NULL COMMENT '服务承诺',
  `seller_id` bigint(19) DEFAULT '0' COMMENT '店铺id',
  `uid` bigint(19) DEFAULT NULL COMMENT '创建人',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除 1表示删除',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `sort` int(10) NOT NULL DEFAULT '9999' COMMENT '商品排序',
  `goods_code` varchar(255) DEFAULT NULL COMMENT '商品编码',
  `intro` longtext COMMENT '详情',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
-- Records of wooshop_store_goods
-- ----------------------------

