-- Table structure for wooshop_store_goods_attr_details
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_store_goods_attr_details`;
CREATE TABLE `wooshop_store_goods_attr_details` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '属性详情参数表',
  `goods_id` bigint(19) NOT NULL COMMENT '关联商品id',
  `attr_text` longtext COMMENT '属性参数 json',
