-- ----------------------------
-- Table structure for wooshop_store_goods_suk
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_store_goods_suk`;
CREATE TABLE `wooshop_store_goods_suk` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `specification_value` text COMMENT '属性对应',
  `goods_id` bigint(19) DEFAULT NULL COMMENT '商品id',
  `suk` varchar(255) DEFAULT NULL COMMENT '商品属性索引值',
  `quantity` int(10) DEFAULT '0' COMMENT '库存',
  `sales` int(10) DEFAULT '0' COMMENT '销售量',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '金额',
  `suk_img` varchar(1000) DEFAULT NULL COMMENT '规格图片',
  `cost` decimal(10,2) DEFAULT '0.00' COMMENT '成本',
  `goods_code` varchar(150) DEFAULT NULL COMMENT '编码',
  `original_price` decimal(10,2) DEFAULT '0.00' COMMENT '原价',
  `weight` decimal(10,2) DEFAULT '0.00' COMMENT '商品重量',
  `volume` decimal(10,2) DEFAULT '0.00' COMMENT '商品体积',
  `distribution` decimal(10,2) DEFAULT '0.00' COMMENT '一级分销佣金',
  `distribution_second` decimal(10,2) DEFAULT '0.00' COMMENT '二级分销佣金',
  `activity_type` tinyint(1) DEFAULT '0' COMMENT '活动类型 0普通商品 1秒杀 2砍价 3拼团',
  `restrictions` int(10) DEFAULT '0' COMMENT '活动限购数量',
  `restrictions_show` int(10) DEFAULT '0' COMMENT '显示限购的数量',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除 1删除',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
