  `att_name` varchar(150) NOT NULL DEFAULT '' COMMENT '附件名称',
  `att_dir` varchar(250) NOT NULL DEFAULT '' COMMENT '附件路径',
  `satt_dir` varchar(250) DEFAULT NULL COMMENT '压缩图片路径',
