  `article_author` varchar(255) DEFAULT '' COMMENT '文章作者',
  `cover_image` varchar(255) NOT NULL COMMENT '文章图片',
  `synopsis` varchar(255) DEFAULT '' COMMENT '文章简介',
  `share_title` varchar(255) DEFAULT '' COMMENT '文章分享标题',
  `share_synopsis` varchar(255) DEFAULT '' COMMENT '文章分享简介',
  `like_num` int(10) DEFAULT NULL COMMENT '点赞数',
  `visit_count` int(10) DEFAULT NULL COMMENT '浏览次数',
  `sort` int(5) unsigned NOT NULL DEFAULT '9999' COMMENT '排序',
  `url` varchar(300) DEFAULT '' COMMENT '原文链接',
  `media_id` varchar(150) DEFAULT NULL COMMENT '微信素材id',
  `is_start` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态 1启用 0关闭',
  `hide` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否隐藏 0否',
  `admin_id` int(10) unsigned DEFAULT '0' COMMENT '管理员id',
