-- ----------------------------
-- Table structure for wooshop_user_bill
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_user_bill`;
CREATE TABLE `wooshop_user_bill` (
  `id` bigint(19) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `uid` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '用户uid',
  `link_id` varchar(35) NOT NULL DEFAULT '0' COMMENT '关联id',
  `bill_pm` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0 = 支出 1 = 获得',
  `bill_title` varchar(65) NOT NULL DEFAULT '' COMMENT '会员账单标题',
  `category` varchar(65) NOT NULL DEFAULT '' COMMENT '账单明细种类',
  `bill_type` varchar(65) NOT NULL DEFAULT '' COMMENT '账单明细类型',
  `bill_number` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '账单明细数字',
  `balance` decimal(16,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '账单剩余',
  `mark` varchar(520) NOT NULL DEFAULT '' COMMENT '账单备注',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 = 待确定 1 = 有效 -1 = 无效',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除: 1表示删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `openid` (`uid`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `add_time` (`create_time`) USING BTREE,
  KEY `bill_pm` (`bill_pm`) USING BTREE,
  KEY `bill_type` (`category`,`bill_type`,`link_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员账单表';

