-- ----------------------------
-- Table structure for wooshop_user_brokerage_record
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_user_brokerage_record`;
CREATE TABLE `wooshop_user_brokerage_record` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `uid` bigint(19) NOT NULL DEFAULT '0' COMMENT '用户uid',
  `link_id` varchar(32) NOT NULL DEFAULT '0' COMMENT '关联id（orderNo,提现id）',
  `link_type` varchar(32) NOT NULL DEFAULT '0' COMMENT '关联类型（order,extract，yue）',
  `bro_type` int(1) NOT NULL DEFAULT '1' COMMENT '类型：1-增加，2-扣减（提现）',
  `bro_title` varchar(64) NOT NULL DEFAULT '' COMMENT '标题',
  `bro_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `bro_balance` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '剩余',
  `bro_mark` varchar(512) NOT NULL DEFAULT '' COMMENT '备注',
  `is_start` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1-订单创建，2-冻结期，3-完成，4-失效（订单退款），5-提现申请',
  `frozen_time` int(3) NOT NULL DEFAULT '0' COMMENT '冻结期时间（天）',
  `thaw_time` bigint(14) NOT NULL DEFAULT '0' COMMENT '解冻时间',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `brokerage_level` int(2) DEFAULT NULL COMMENT '分销等级',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除:1表示删除、0默认',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `openid` (`uid`) USING BTREE,
  KEY `is_start` (`is_start`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE,
  KEY `bro_type` (`bro_type`) USING BTREE,
  KEY `bro_type, link_id` (`bro_type`,`link_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员佣金记录表';

-- ----------------------------
-- Records of wooshop_user_brokerage_record
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_user_experience_record
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_user_experience_record`;
CREATE TABLE `wooshop_user_experience_record` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '经验记录表主键id',
  `uid` bigint(19) NOT NULL DEFAULT '0' COMMENT '用户uid',
  `link_id` varchar(35) NOT NULL DEFAULT '0' COMMENT '关联id-orderNo,(sign,system默认为0）',
  `link_type` varchar(30) NOT NULL DEFAULT 'order' COMMENT '关联类型（order,sign,system）',
  `record_type` int(1) NOT NULL DEFAULT '1' COMMENT '类型：1-增加，2-扣减',
  `record_title` varchar(64) NOT NULL DEFAULT '' COMMENT '标题',
  `experience` int(11) NOT NULL DEFAULT '0' COMMENT '经验',
  `balance` int(11) NOT NULL DEFAULT '0' COMMENT '剩余',
  `mark` varchar(520) NOT NULL DEFAULT '' COMMENT '备注',
  `is_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1-成功（保留字段）0-失败',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除: 1-删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `uid` (`uid`) USING BTREE,
  KEY `is_status` (`is_status`) USING BTREE,
  KEY `add_time` (`create_time`) USING BTREE,
  KEY `record_type` (`record_type`) USING BTREE,
  KEY `type_link` (`record_type`,`link_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员经验记录表';

-- ----------------------------
-- Records of wooshop_user_experience_record
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_user_level
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_user_level`;
CREATE TABLE `wooshop_user_level` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `uid` bigint(19) NOT NULL DEFAULT '0' COMMENT '用户uid',
  `level_id` int(11) NOT NULL DEFAULT '0' COMMENT '等级vip',
  `grade` int(11) NOT NULL DEFAULT '0' COMMENT '会员等级',
  `is_start` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:禁止,1:正常',
  `mark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `remind` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已通知',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除,0=未删除,1=删除',
  `discount` int(4) NOT NULL DEFAULT '100' COMMENT '享受折扣',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `expired_time` timestamp NULL DEFAULT NULL COMMENT '过期时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='用户等级记录表';

-- ----------------------------
-- Records of wooshop_user_level
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_user_visit_record
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_user_visit_record`;
CREATE TABLE `wooshop_user_visit_record` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时期',
  `uid` bigint(19) DEFAULT NULL COMMENT '用户uid',
  `visit_type` int(2) DEFAULT NULL COMMENT '访问类型:1-首页，2-详情页，3-营销活动详情页，4-个人中心，5-购物车、6-商品分类、7列表、8签到、9余额中心',
  `create_ip` varchar(100) DEFAULT '' COMMENT '访问ip地址',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `clientType` varchar(50) DEFAULT NULL COMMENT '设备类型',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除',
  `goods_id` bigint(19) DEFAULT NULL COMMENT '商品id',
  `goods_type` tinyint(1) DEFAULT '0' COMMENT '商品类型:0非商品、1普通商品、2砍价商品、3团购商品、4秒杀商品、5积分商品',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='用户访问记录表';

-- ----------------------------
-- Records of wooshop_user_visit_record
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_wechat_menu
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_wechat_menu`;
CREATE TABLE `wooshop_wechat_menu` (
  `id` bigint(9) NOT NULL AUTO_INCREMENT,
  `name_key` varchar(32) NOT NULL,
  `value_result` text COMMENT '缓存数据',
  `add_time` int(10) DEFAULT NULL COMMENT '缓存时间',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信公众号缓存表';

-- ----------------------------
-- Records of wooshop_wechat_menu
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_wechat_reply
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_wechat_reply`;
CREATE TABLE `wooshop_wechat_reply` (
  `id` bigint(19) unsigned NOT NULL AUTO_INCREMENT COMMENT '微信关键字回复id主键',
  `reply_key` varchar(65) NOT NULL DEFAULT '' COMMENT '关键字',
  `reply_type` varchar(35) NOT NULL DEFAULT '' COMMENT '回复类型',
  `reply_data` text NOT NULL COMMENT '回复数据',
  `is_status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0=不可用  1 =可用',
  `reply_hide` tinyint(1) unsigned DEFAULT '0' COMMENT '是否隐藏',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除:1删除',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `reply_key` (`reply_key`) USING BTREE,
  KEY `reply_type` (`reply_type`) USING BTREE,
  KEY `reply_status` (`is_status`) USING BTREE,
  KEY `reply_hide` (`reply_hide`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信公众号关键字回复表';

-- ----------------------------
-- Records of wooshop_wechat_reply
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_wechat_template
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_wechat_template`;
CREATE TABLE `wooshop_wechat_template` (
  `id` bigint(19) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `temp_code` varchar(55) NOT NULL DEFAULT '' COMMENT '模板编号',
  `temp_name` varchar(150) NOT NULL DEFAULT '' COMMENT '模板名称',
  `temp_content` varchar(1000) NOT NULL DEFAULT '' COMMENT '回复内容',
  `temp_id` varchar(150) DEFAULT NULL COMMENT '模板ID',
  `create_time` datetime NOT NULL COMMENT '添加时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `is_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态:0不启用/1启用',
  `is_del` tinyint(1) DEFAULT '0',
  `temp_type` varchar(30) DEFAULT NULL COMMENT '类型：temp:模板消息 sub:订阅消息',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `temp_code` (`temp_code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信模板表';

-- ----------------------------
-- Records of wooshop_wechat_template
-- ----------------------------

-- ----------------------------
-- Table structure for wooshop_withdraw_record
-- ----------------------------
DROP TABLE IF EXISTS `wooshop_withdraw_record`;
CREATE TABLE `wooshop_withdraw_record` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `uid` bigint(19) NOT NULL COMMENT '会员id',
  `withdraw_name` varchar(255) DEFAULT NULL COMMENT '提款名称',
  `withdraw_type` tinyint(1) DEFAULT '0' COMMENT '提现方式:1支付宝,2微信',
  `alipay_code` varchar(100) DEFAULT NULL COMMENT '支付宝账号',
  `wechat_code` varchar(10) DEFAULT NULL COMMENT '提款微信号',
  `withdraw_money` decimal(10,2) DEFAULT '0.00' COMMENT '提款金额',
  `mark` varchar(255) DEFAULT NULL COMMENT '备注',
  `after_balance` decimal(10,2) DEFAULT '0.00' COMMENT '剩余余额',
  `audit_msg` varchar(255) DEFAULT NULL COMMENT '审核情况',
  `is_start` tinyint(1) DEFAULT '0' COMMENT '审核状态:0审核中、1已提现、2未通过、3会员撤销',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '申请时间',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '逻辑删除 1删除',
  `fail_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '提现失败时间',
  `qr_code` varchar(500) DEFAULT NULL COMMENT '微信/支付宝收款二维码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户提现记录表';

-- ----------------------------
-- Records of wooshop_withdraw_record
-- ----------------------------

-- ----------------------------
-- Table structure for woo_sys_config
-- ----------------------------
DROP TABLE IF EXISTS `woo_sys_config`;
CREATE TABLE `woo_sys_config` (
  `id` int(9) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `menu_name` varchar(255) DEFAULT NULL COMMENT '名称',
  `value` varchar(10000) DEFAULT NULL COMMENT '值',
  `enabled` tinyint(1) DEFAULT '1' COMMENT '状态：1启用、0禁用',
  `is_del` tinyint(1) DEFAULT '0',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `sort` int(5) DEFAULT '999' COMMENT '排序 数字越小越靠前',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COMMENT='系统配置';

